import React, { Component } from 'react';
import styleGlasses from "./Glasses.module.css"
import data from "../Data";
class Glasses extends Component {
  render() {
    return (
      <div className={styleGlasses.glasses}>
        {Data.map(item=>{
        <button className={styleGlasses.glasses__button}>
          <img src={item.name} alt="" className={styleGlasses.button__image} />
        </button>;   
        })}
      </div>
    );
  }
}

export default Glasses;
